import { Link } from 'react-router-dom'


const Navbar = () => {
    
    

    return (  
       <div className="navbar">
           <Link to="/">Highlights</Link> 
           <a class="active"></a>
           <a>Finance</a>
           <a>Politics</a>
           <a>Economy</a>
           <a>Technology</a>
           <a>Entertainment</a>
       </div>
    );
}
 
export default Navbar;
